    [],nt"revision_timestamp": "2016-07-27T22:48:45.676124",nt"name": "steelhead-returns-to-warm-springs-national-fish-hatchery-1978-2003",nt"isopen":
    false,nt"url": null,nt"notes": "The Warm Springs River is a major tributary
    of the Deschutes River in north-central Oregon, and supports a population of wild
    summer steelhead (Oncorhynchusmykiss). Summer steelhead in the Deschutes River basin
    are part of the mid-Columbia River Evolutionary Significant Unit that was listed
    as a threatened species by NOAA Fisheriesin 1999. Warm Springs National Fish Hatchery,
    located on the Warm Springs River, was constructed in 1978 and was initially designed
    to produce spring Chinook salmon (Oncorhynchus tshawytscha), summer steelhead, and
    rainbow trout(Oncorhynchus mykiss). The hatchery program is cooperatively managed
    by the Confederated Tribes of the Warm Springs Reservation of Oregon and the U.S.
    Fish and Wildlife Service. In 1981, the summer steelhead program was discontinued
    due to facility constraints and disease problems. The hatchery currently produces
    spring Chinook salmon for sport and Tribal harvests. Current operation of the hatchery
    is intended to conserve wild fish populations upstream of the hatchery by only allowing
    wild fish and a small proportion of hatchery spring Chinook salmon to pass upstream
    of the hatchery (CTWSRO and USFWS 2002). A barrier dam blocks all upstream migration
    of fish and diverts fish into a fish ladder located at the hatchery. This report
    summarizes information collected by hatchery personnel on adult steelhead populations
    passing through the fish ladder at Warm Springs National Fish Hatchery.",nt"license_title":
